import styles from "./header.module.css";

const Header = () => {
  return (
    <div>
    <div className={styles.header}>
      <h1>ReactMeals</h1>
      <div className={styles.yourcart}>
        <p>Your Cart</p>
      </div>
    </div>
    </div>
  );
};

export default Header;
